while (!pool->shutdown) {
    int client_fd = accept(server_fd, ...);
    if (client_fd < 0) {
        if (pool->shutdown) break;
        continue;
    }
    submit_to_pool(client_fd);
}
close(server_fd); // Stop new TCP handshakes

